import React from 'react';
import {useForm} from "react-hook-form";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import classes from "./CustomForm.module.scss";
import InputEmail from "../InputEmail/InputEmail";
import PasswordInput from "../PasswordInput/PasswordInput";
const CustomForm = ({btnText, register, errors, handlerSubmit, isValid, submitHandler}) => {

    return (
        <Form onSubmit={handlerSubmit(submitHandler)} className={classes.formCl}>
           <InputEmail errors={errors} register={register}/>
           <PasswordInput errors={errors} register={register}/>
            <div className={classes.btnCl}>
                <Button disabled={!isValid} variant="primary" type="submit">
                    {btnText}
                </Button>
            </div>
        </Form>
    );
};

export default CustomForm;
